import React from 'react';


const Contact = () => {
    return (
        <div className="Contact">
                <h1>Contact US</h1>
                <p><i>If you have a question, comment, or suggestion, please send us an email at:</i>
                    <br />
                    <br />
                    &nbsp;&nbsp;&nbsp;&nbsp;<b>fusion.eng.uci@gmail.com</b></p>

                <h1>Social Media</h1>
                <p>Connect with us through the following platforms:</p>

            &nbsp;&nbsp;&nbsp;&nbsp;<p>Fusion at UCI</p>
            &nbsp;&nbsp;&nbsp;&nbsp;<p>@fusionatuci</p>

        </div>
);
}

export default Contact;
